import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from "react-router-dom";


ReactDOM.render(
    <BrowserRouter>
        <UserContext>
            <App />
        </UserContext>
    </BrowserRouter>,
    document.getElementById('root')
);
